import React from 'react'


const Personajes = ({personaje = []}) =>{

    return(

    <div className='row'>
                  { personaje.map(pers => { 
                      return <div class="col">
                      <div key={pers.id} className='g-col-4'>
                               <div className='card'>
                                <img src={pers.image} alt="" />   
                                </div>
                     </div>
                     </div>
                  })
                  }
                  </div>
)
}

export default Personajes
